import SearchBar from "../SearchBar";
import { Link } from "react-router-dom";
export default function Nav(props) {

    return (
        <div style={{
            width: '100%',
            backgroundColor: 'gray',
            display: 'flex',
            position:'relative',
            alignItems:'center',

        }}>
            <div ><SearchBar onSearch={props.onSearch} /></div>

            <div style={{ display: 'flex', 
            position:'absolute', 
            right:'50%', 
           
            }}>
                <div
                style={{
                    margin:10,
                    
                }}><Link to={"/home"} style={{color:'white',
                textDecoration:'none'}}><div >Home</div></Link></div>
                <div style={{
                    margin:10
                }}><Link to={"/about"}><div>About</div></Link></div>
            </div>


        </div>
    );

}
